    <style>
      body {
        font-family: Arial, sans-serif;
        background-color: #f4f4f9;
        padding: 20px;
      }
      h2 {
        text-align: center;
        color: #333;
      }
      .form-group {
        margin-bottom: 15px;
      }
      label {
        display: block;
        margin-bottom: 5px;
        color: #333;
      }
      input {
        width: 100%;
        padding: 10px;
        border: 1px solid #ccc;
        border-radius: 4px;
      }
      #login-button {
        width: 100%;
        padding: 10px;
        background-color: #28a745;
        color: white;
        border: none;
        border-radius: 4px;
        cursor: pointer;
      }
      #login-button:hover {
        background-color: #218838;
      }
      button {
        margin-top: -11px;
        margin-left: -10px;
        padding: 10px 20px;
        background-color: #4a90e2;
        color: #ffffff;
        border: none;
        cursor: pointer;
        transition: background-color 0.3s ease-in-out;
      }
    </style>
  </head>

  <body>
    <h2>ログイン</h2>

    <form id="login-form" autocomplete="on">
      <div class="form-group">
        <label for="email">メールアドレス</label>
        <input type="email" id="email" name="email" placeholder="メールアドレスを入力してください" autocomplete="email" required>
      </div>
    
      <div class="form-group">
        <label for="password">パスワード</label>
        <input type="password" id="password" name="password" placeholder="パスワードを入力してください" autocomplete="current-password" required>
      </div>
    
      <button id="login-button" type="submit">ログイン</button>
      <a href="#" id="reset-button">パスワードを忘れた</a>
    </form>

    <p>まだアカウントをお持ちではありませんか？ <a href="registration.html">登録はこちら</a></p>
